import React from "react";

const Dropdown = () => {
  return (
    <div className="relative w-full max-w-[500px] p-5">
      <div className="p-5 border border-gray-500 rounded-lg w-full cursor-pointer">
        Selected
      </div>
      <div className="p-5 border border-gray-500 rounded-lg">
        <div className="py-3 border">JavaScript</div>
      </div>
    </div>
  );
};

export default Dropdown;
